import React from 'react';
import { Grid } from '@material-ui/core';
import PicHome from './img/3330669.jpg';
function Home() {

  return (
    <div className="">
        <Grid container spacing={2}  >
            <Grid item xs={12} md={6} style={{height:'80vh'}} >
                <img src={PicHome} style={{width: "100%",  maxHeight: "100%"}}/>
            </Grid>
        </Grid>
    </div>
    
  );
}

export default Home;
